import React from 'react';
import Navbar from './Navbar';
import Sidenav from './Sidenav';
import  {Switch, Route } from 'react-router-dom';

export default function HeaderComponent() {
  return <>
  <Navbar/>
  <Sidenav/>

  {/* Register Routes */}
  <Switch>
    <Route/>
  </Switch>
  </>;
}
